import React from "react";
import friends from "../../../img/icon_friends.png";
import style from "../Navbar.module.css";

const Friends = () => {
    return (
        <div>
            <a><img className={style.icon} src={friends} alt="friends"/></a>
        </div>
    );
}

export default Friends;
